                  if (["alignSelf", "justifySelf", "placeSelf"].includes(item.name)) {
                    setItemStyle(v => ({ ...v, [item.name]: e.value }))
                  } else setWrapperStyle(v => ({ ...v, [item.name]: e.value }))
